import React from "react";

// Componente para a página E-Minuta
const EMinuta = () => {
  return (
    <div>
      <h2>Página E-Minuta</h2>
      <p>Conteúdo da página de E-Minuta.</p>
    </div>
  );
};

// Componente para o botão que abre a E-Minuta em uma nova aba
const EMinutaButton = () => {
  // URL oficial da E-Minuta
  const eMinutaURL = "https://www.latamcargo.com/pt/eminutaclient";

  return (
    <button
      className="eminuta-button"
      onClick={() => window.open(eMinutaURL, "_blank")}
    >
      Abrir E-Minuta
    </button>
  );
};

// Exportando ambos os componentes
export { EMinuta, EMinutaButton };
